INSERT INTO `AppInfo` (`id`, `data_version`, `news_en`, `news_tc`, `news_sc`, `last_update`) VALUES
(1, '2209004', 'Temporary arrangements for entrances to the Legislative Council Complex \n\nVisitors who have reserved parking spaces are requested to go through security\nscreening at Footbridge Entrance via the four lifts’ lobby on LG1 Carpark. ', '立法會綜合大樓入口的臨時安排\n\n已預訂使用訪客泊車位的人士，請經地下低層停車場(LG1)4 部升降機大堂到\n天橋入口進行安全檢查。', '立法会综合大楼入口的临时安排\n\n已预订使用访客泊车位的人士，请经地下低层停车场(LG1)4 部升降机大堂到\n天桥入口进行安全检查。', '2022-09-02 12:01:23');
