(1, '1/2022', '2022-06-16 10:30:00', 1, 'https://www.gld.gov.hk/assets/gld/download-files/auction/Auction-List-1-2022-en-zh-hk.pdf', 'https://www.gld.gov.hk/assets/gld/download-files/auction/Auction-List-1-2022-en-zh-hk.pdf', 'https://www.gld.gov.hk/assets/gld/download-files/auction/Auction-List-1-2022-en-zh-cn.pdf', 'https://www.gld.gov.hk/assets/gld/download-files/auction/Auction-Result-1-2022-zh-hk.pdf', 'https://www.gld.gov.hk/assets/gld/download-files/auction/Auction-Result-1-2022-zh-hk.pdf', 'https://www.gld.gov.hk/assets/gld/download-files/auction/Auction-Result-1-2022-zh-cn.pdf', 'Remarks : In case Tropical Cyclone Warning Signal No. 8 or above is hoisted or Black Rainstorm Warning Signal or \"extreme conditions after super typhoons\" announced by the Government is/are in force for any duration between 8:00 a.m. and 10:30 a.m. on the auction date, the auction time will be extended to 10:30 a.m. on the next working day. All time references are Hong Kong time.', '備註：如拍賣會當天上午8時至10時30分期間八號或以上的熱帶氣旋警告訊號或黑色暴雨警告訊號或政府公布的「超強颱風後的極端情況」生效，拍賣會時間會延至下一個工作天上午10時30分。 所有時間的表述均為香港時間。', '备注：如拍卖会当天上午8时至10时30分期间八号或以上的热带气旋警告讯号或黑色暴雨警告讯号或政府公布的「超强台风后的极端情况」生效，拍卖会时间会延至下一个工作天上午10时30分。 所有时间的表述均为香港时间。', 'F', 'A', '2022-08-25 16:47:34'),
