(95, 1, 3, 'M-135', 95, 'AUC/11/2003/2022', 'AFCD/DDC/025/21', 'Agriculture, Fisheries and Conservation Department', '漁農自然護理署', '渔农自然护理署', 'Ms LEUNG / Mr LAM', '梁女士 / 林先生', '梁女士 / 林先生', '3468 3444 / 3468 3304', '3468 3444 / 3468 3304', '3468 3444 / 3468 3304', 'Marine Parks East Section, Unit 2209, CDW Building, 388 Castle Peak Road, Tsuen Wan', '荃灣青山公路388號中染大廈2209室海岸公園(東區)組', '荃湾青山公路388号中染大厦2209室海岸公园(东区)组', '1. Item No.12: AFCD purchased this Small Unmanned Aircraft on 13 March 2015, and there was no control at the time. The weight of this Small Unmanned Aircraft was 1242 grams. 《Small Unmanned Aircraft Order》was gazetted on 2021. Under the new regulatory, Small Unmanned Aircraft weighing less than 250 grams do not need special regulations, but the flight height must not exceed 30 meters. For drones of 250 grams to 7 kilograms, the flying height must not exceed 90 meters, and the remote pilots must register and buy insurance. As for Small Unmanned Aircraft weighing more than 7 kilograms, in addition to registering and buying insurance, the remote pilots must receive training and pass the assessment. In addition, all Small Unmanned Aircraft must be flown during the day and application of permit is required to fly at night.', '1. 項目12 : 本部門在2015年3月13日購入此部航拍機當時並沒有管制，此部航拍機重量為1242克，在今年刊憲生效的《小型無人機令》內容如下，重量在250克以下的無人機無需特別規管，惟飛行高度不得超出30米。而250克至7公斤的無人機，飛行高度不得超過90米，而駕駛者必需要註冊及強制買保險。至於重量超過7公斤的無人機，駕駛員除要註冊及買保險外，更加要接受培訓及通過考核。除此之外，所有無人機必需在日間飛行，晚間飛行需申請許可。', '1. 项目12 : 本部门在2015年3月13日购入此部航拍机当时并没有管制，此部航拍机重量为1242克，在今年刊宪生效的《小型无人机令》内容如下，重量在250克以下的无人机无需特别规管，惟飞行高度不得超出30米。而250克至7公斤的无人机，飞行高度不得超过90米，而驾驶者必需要注册及强制买保险。至于重量超过7公斤的无人机，驾驶员除要注册及买保险外，更加要接受培训及通过考核。除此之外，所有无人机必需在日间飞行，晚间飞行需申请许可。', 'May be Unserviceable/May Not Function Properly/May be Damaged', '或不能再用/或不能正常操作/或已有損壞', '或不能再用/或不能正常操作/或已有损坏', 'fontawesome.box', '', b'0', '', 0, 'N', 'A', '2022-08-23 17:01:45'),
